 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Ruang Pengolahan</B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"> berfungsi sebagai tempat pengelolaan bahan pustaka, mulai dari proses katalogisasi, klasifikasi, hingga pelabelan koleksi yang akan disajikan kepada pengguna. Selain itu, ruang ini juga menangani perawatan bahan pustaka yang rusak dan terdapat Pelayanan </SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Uji Similaritas (Turnitin)</B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"> untuk mendeteksi tingkat kemiripan karya tulis akademik.</SPAN></SPAN></DIV></div>",
