 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B><I>Front Office</I></B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B> </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\">merupakan area layanan pertama yang dapat dijumpai dan ditemui oleh pengunjung perpustakaan. Pada area bagian ini, pengunjung dapat memperoleh berbagai informasi umum yang terkait dengan layanan perpustakaan. </SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B><I>Front Office</I></B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"> juga melayani pembuatan dan pendaftaran kartu anggota perpustakaan, serta juga dapat menangani proses pengembalian dan perpanjangan masa pinjam buku. Area ini menjadi bagian titik awal interaksi antara pengguna dan sistem layanan perpustakaan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
