 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Ruang Koleksi Cadangan </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\">merupakan ruang yang digunakan untuk menyimpan koleksi cadangan, seperti buku-buku penting yang hanya tersedia satu eksemplar pada perpustakaan. Buku-buku di ruangan ini tidak diperkenankan untuk dipinjam kecuali dengan alasan tertentu yang dapat dipertanggungjawabkan, dan hanya dapat dibaca di tempat tertentu untuk menjaga ketersediaannya bagi semua pengguna.</SPAN></SPAN></DIV></div>",
