 "paddingTop": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Ruang Diskusi</B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"> di perpustakaan adalah area khusus untuk memfasilitasi pembelajaran kelompok. Berbeda dengan area baca yang hening, ruangan ini menyediakan lingkungan yang memungkinkan pengguna untuk berbicara, berdiskusi, dan bekerja sama tanpa mengganggu pengunjung perpustakaan lainnya. Ruangan ini berada di luar ruang koleksi dan dapat digunakan untuk berdiskusi maupun belajar sampai pukul 10 malam.</SPAN></SPAN></DIV></div>",
