 "class": "HTMLText",
 "borderSize": 0,
 "paddingTop": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Ruang Sirkulasi </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\">adalah area utama yang menyediakan koleksi buku tercetak yang dapat dipinjam oleh anggota perpustakaan. Dalam ruangan ini juga tersedia layanan peminjaman buku dan pelayanan bebas pustaka. Pengunjung dapat memanfaatkan beberapa meja dan kursi baca yang disediakan untuk membaca secara langsung diruangan. Selain itu, dalam ruangan ini terdapat komputer penelusuran </SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>(OPAC) </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\">yang dapat memungkinkan pengguna untuk mencari koleksi buku berdasarkan judul, pengarang, atau subjek.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
