 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Co-Working Space </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\">merupakan ruang yang dirancang sebagai tempat belajar mandiri maupun diskusi kelompok dengan suasana terbuka dan fleksibel. Terdapat meja panjang yang juga dapat digunakan untuk berdiskusi maupun belajar sendiri. Area ini juga memiliki ruang diskusi luar yang dapat dimanfaatkan hingga pukul 10 malam, cocok untuk kegiatan kolaboratif hingga malam hari.</SPAN></SPAN></DIV></div>",
