 "class": "HTMLText",
 "borderSize": 0,
 "paddingTop": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;\"> \u2022 </SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Ruang KA UPT</B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"> merupakan kantor bagi Kepala Unit Pelaksana Teknis (UPT) pada Perpustakaan. Di dalam ruang tersebut berlangsung kegiatan manajerial dan juga pengambilan keputusan strategis yang berkaitan dengan pengelolaan sistem serta pengembangan layanan perpustakaan.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;\"> \u2022 </SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Ruang Rapat </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\">digunakan untuk kegiatan rapat internal staff perpustakaan maupun pertemuan dengan pihak eksternal. Ruang rapat mendukung kegiatan diskusi, evaluasi program kerja, dan perencanaan kegiatan perpustakaan.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;\"> \u2022 </SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"><B>Ruang TU</B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'David';\"> merupakan ruang pusat kegiatan administrasi pada perpustakaan. Pada ruangan inilah dilakukannya pengelolaan surat menyurat, pencatatan inventaris, serta urusan kepegawaian dan keuangan yang berkaitan dengan operasional yang ada di perpustakaan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
